import React,{useState} from "react";
import { Camp } from "./components/AchivmentsCpm/Camp";
import { FullGradde } from "./components/AchivmentsCpm/FullGrade";
import { Training } from "./components/AchivmentsCpm/Training";
import { Events } from "./components/AchivmentsCpm/Events";
import { FullInformation } from "./components/AchivmentsCpm/FullInformation";

export const Tournament = () =>{
    const [show,setShow] = useState(false);
    if(!show){
        return(
            <section>
                <div class="container">
               
                    <h3 class="title" style={{cursor:'pointer'}} onClick={()=>setShow(true)}>Достижения</h3>
               
                </div>
            </section>
        )
    }else{
        return(
            <section>
                <div  class="container">
                <div class="container">
               
                    <h3  class="title" style={{cursor:'pointer'}} onClick={()=>setShow(false)}>Достижения</h3>
                    <div class="container">
                    <div>
                           <Training/>
                    </div>
                    <div>
                           <Camp/>
                    </div>
                    <div>
                           <Events/>
                    </div>
                    <div>
                           <FullGradde/>
                    </div>
                    <div>
                           <FullInformation/>
                    </div>
                    </div>
                
                </div>
                </div>
            </section>
        )

    }
    
}
